import React from "react";
import { Route } from "react-router-dom";
import mailList from "./mailList";
import addMail from "../addMail";

function mail({ match }) {
  return (
    <>
      <Route exact path={match.path} component={mailList} />
      <Route path={`${match.path}/:id`} component={addMail} />
    </>
  );
}

export default mail;
